import React from 'react';
import { Navbar, NavbarBrand, Nav, NavItem, NavLink } from 'reactstrap';
import { Link } from 'react-router-dom';

const MyNavbar = () => {
  return (
    <Navbar color="success" dark expand="md" style={{ backgroundColor: '#556B2F' }}> {/* Color verde musgo */}
      <NavbarBrand href="/">Mi App</NavbarBrand>
      <Nav className="ml-auto" navbar>
        <NavItem>
          <NavLink tag={Link} to="/">Home</NavLink>
        </NavItem>
        <NavItem>
          <NavLink tag={Link} to="/about">About</NavLink> {/* Nueva ruta */}
        </NavItem>
        <NavItem>
          <NavLink tag={Link} to="/services">Services</NavLink> {/* Nueva ruta */}
        </NavItem>
      </Nav>
    </Navbar>
  );
};

export default MyNavbar;
